import React, { useState } from 'react';
import './index.css';
const Ques=(props)=>{
    const [fun,set2]=useState(false);
    function open(){
        set2(!fun);
    }
    return (<>
        <div className='ques'>
            <span onClick={open}>{fun? "-" : "+" }</span>
            <span>{props.question}</span>
            <span>{fun && <p>{props.answer}</p>}</span>
        </div>
    </>);
}
export default Ques;
